// src/pages/home.js
import React from "react";
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';
import adventureTimeImage from '../assets/Adventure-time.png'; // Correctly import the image
import './home.css'; // Make sure to import your CSS for styling

function Home() {
    return (
        <div className="container text-center" style={{ marginTop: '50px' }}>
            <h1>Welcome to Voyage-Voyage</h1>
            <Link to="/create-itinerary">
                <Button variant="primary" size="lg" style={{ marginTop: '20px' }}>
                    Create Your Trip
                </Button>
            </Link>
            <h4 style={{ fontStyle: 'italic' }}>This web made by</h4>
            <img src={adventureTimeImage} alt="Adventure Time Travel Scene" className="main-image" />
        </div>
    );
}

export default Home;
